Paneer is a staple Indian cottage cheese used in so many varieties of dishes and is made by curdling fresh full fat milk with vinegar, lemon juice or you can also use yogurt.

Once the milk is curdled, you place the cheese in a muslin cloth and then let it set until it‚Äôs firm.

Home made paneer is luxuriously soft and delicious and best of all free of added nasties such as preservatives. 

Recipie

Ingredients

‚Ä¢ 4 pints of whole full fat fresh milk
‚Ä¢ 1/4 cup of lemon juice fresh or from a bottle.
Method
‚Ä¢ Add milk to a heavy bottom pan on medium heat.
‚Ä¢ Allow the he milk come to a boil stirring as often as possible so that it doesn‚Äôt stick to the bottom of the pan.
‚Ä¢ Once the milk has come to a boil, turn off the heat and start adding vinegar (or lemon juice), a small amount a go.
‚Ä¢ At some point, the milk will curdle and you will see the whey separate. At that point, stop adding the curdling agent of lemon juice or vinegar and wait for 5 minutes so that the milk curdles completely.
‚Ä¢ Drain the curdled milk into a thin clean muslin cloth. Rinse the paneer with cold water so that the final paneer doesn‚Äôt have any taste of vinegar.
‚Ä¢ Tie the ends of muslin cloth together and squeeze as much water as you can.
‚Ä¢ Then press and flatten the paneer (wrapped inside the muslin cloth) and place it on a flat surface. Place a heavy object on top for it to set. I placed a plate and then placed marble stone on top. Leave it for 1 to 2 hours to set without peeking.
‚Ä¢ Once the paneer is set, remove it carefully from the muslin cloth use paneer in any of your favorite recipes.
‚Ä¢ For creamier textured paneer, add 1/4 cup heavy cream to the milk while boiling it. However this makes it rather heavy but some like this. We use Waitrose brand milk seems to get the best Results

